import { View, StatusBar } from 'react-native';
import { StyleSheet } from 'react-native';
import TopBar from './components/TopBar';


const App = () => {
  return (
    <View style={{ flex: 4 }}>
      <StatusBar
        animated={true}
        backgroundColor="blue"
        hidden={false} />
      <TopBar />
    </View>
  );
};

export default App;
